  "webpack:///src/components/LayoutFooter/Footer.js": "/**\n * Copyright (c) 2013-present, Facebook, Inc.\n *\n * @emails react-core\n * @flow\n */\n\nimport Container from 'components/Container';\nimport ExternalFooterLink from './ExternalFooterLink';\nimport FooterLink from './FooterLink';\nimport FooterNav from './FooterNav';\nimport MetaTitle from 'templates/components/MetaTitle';\nimport SectionLinks from './SectionLinks';\nimport React from 'react';\nimport {colors, media} from 'theme';\nimport {sectionListCommunity, sectionListDocs} from 'utils/sectionList';\n\n// $FlowFixMe\nimport navFooter from '../../../content/footerNav.yml';\n\nimport ossLogoPng from 'images/oss_logo.png';\n\nconst Footer = ({layoutHasSidebar = false}: {layoutHasSidebar: boolean}) => (\n  <footer\n    css={{\n      backgroundColor: colors.darker,\n      color: colors.white,\n      paddingTop: 10,\n      paddingBottom: 50,\n\n      [media.size('sidebarFixed')]: {\n        paddingTop: 40,\n      },\n      '@media print': {\n        display: 'none',\n      },\n    }}>\n    <Container>\n      <div\n        css={{\n          display: 'flex',\n          flexDirection: 'row',\n          flexWrap: 'wrap',\n\n          [media.between('small', 'medium')]: {\n            paddingRight: layoutHasSidebar ? 240 : null,\n          },\n\n          [media.between('large', 'largerSidebar')]: {\n            paddingRight: layoutHasSidebar ? 280 : null,\n          },\n          [media.between('largerSidebar', 'sidebarFixed', true)]: {\n            paddingRight: layoutHasSidebar ? 380 : null,\n          },\n        }}>\n        <div\n          css={{\n            flexWrap: 'wrap',\n            display: 'flex',\n\n            [media.lessThan('large')]: {\n              width: '100%',\n            },\n            [media.greaterThan('xlarge')]: {\n              width: 'calc(100% / 3 * 2)',\n              paddingLeft: 40,\n            },\n          }}>\n          <FooterNav layoutHasSidebar={layoutHasSidebar}>\n            <MetaTitle onDark={true}>{navFooter.docs.title}</MetaTitle>\n            {sectionListDocs.map(section => {\n              const defaultItem = section.items[0];\n              return (\n                <FooterLink\n                  to={`/docs/${defaultItem.id}.html`}\n                  key={section.title}>\n                  {section.title}\n                </FooterLink>\n              );\n            })}\n          </FooterNav>\n          <FooterNav layoutHasSidebar={layoutHasSidebar}>\n            <MetaTitle onDark={true}>{navFooter.channels.title}</MetaTitle>\n            <SectionLinks links={navFooter.channels.items} />\n          </FooterNav>\n          <FooterNav layoutHasSidebar={layoutHasSidebar}>\n            <MetaTitle onDark={true}>{navFooter.community.title}</MetaTitle>\n            <ExternalFooterLink\n              href={`https://github.com/facebook/react/blob/master/CODE_OF_CONDUCT.md`}>\n              Code of Conduct\n            </ExternalFooterLink>\n            {sectionListCommunity.map(section => (\n              <FooterLink\n                to={`/community/${section.items[0].id}.html`}\n                key={section.title}>\n                {section.title}\n              </FooterLink>\n            ))}\n          </FooterNav>\n          <FooterNav layoutHasSidebar={layoutHasSidebar}>\n            <MetaTitle onDark={true}>{navFooter.more.title}</MetaTitle>\n            <SectionLinks links={navFooter.more.items} />\n          </FooterNav>\n        </div>\n        <section\n          css={{\n            paddingTop: 40,\n            display: 'block !important', // Override 'Installation' <style> specifics\n\n            [media.greaterThan('xlarge')]: {\n              width: 'calc(100% / 3)',\n              order: -1,\n            },\n            [media.greaterThan('large')]: {\n              order: -1,\n              width: layoutHasSidebar ? null : 'calc(100% / 3)',\n            },\n            [media.lessThan('large')]: {\n              textAlign: 'center',\n              width: '100%',\n              paddingTop: 40,\n            },\n          }}>\n          <a\n            href=\"https://code.facebook.com/projects/\"\n            target=\"_blank\"\n            rel=\"noopener\">\n            <img\n              alt=\"Facebook Open Source\"\n              css={{\n                maxWidth: 160,\n                height: 'auto',\n              }}\n              src={ossLogoPng}\n            />\n          </a>\n          <p\n            css={{\n              color: colors.subtleOnDark,\n              paddingTop: 15,\n            }}>\n            {`Copyright © ${new Date().getFullYear()} Facebook Inc.`}\n          </p>\n        </section>\n      </div>\n    </Container>\n  </footer>\n);\n\nexport default Footer;\n",
